import React from 'react';
import { XAxis as RechartsXAxis } from 'recharts';

const XAxis = ({ dataKey = 'defaultKey', ...rest }) => {
  return <RechartsXAxis dataKey={dataKey} {...rest} />;
};

export default XAxis;
